€ 399,000 to 570,000 €. 2 houses the largest surface area (235m2) on two floors with 4 bedrooms and 3 bathrooms from € 720,000 to € 799,000 All homes have large terraces with stunning views of Mount Ponoch, Sierra Bernia and nature that surrounds the complex', 0, NULL, 0, NULL, NULL),
